import styles from '../styles/TodoInput.module.css'

// components
import { useState } from 'react'

const TodoInput = () => {

    const [title, setTitle] = useState("")

    return (
        <form className={styles.container}>
            <input
            type="text"
            onChange={(e) => setTitle(e.target.value)}
            value={title} />
        </form>
    )
}

export default TodoInput
